import React, { useState } from "react";
import PieChartComponent from "./PieChartComponent";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import AgeGroupDetails from "./AgeGroupDetails";
import PieChartFood from "./PieChartFood";
import PieChartBeverage from "./PieChartBeverage";
import RouteQuarterlyChart from "./RouteQuarterlyChart"; // Make sure this file exists
import logo from "../assets/inflight-logo.png";

function Dashboard() {
  const [searchRoute, setSearchRoute] = useState("");
  const [selectedRoute, setSelectedRoute] = useState("");

  const handleSearch = () => {
    if (searchRoute.trim()) {
      setSelectedRoute(searchRoute.trim().toUpperCase());
    }
  };

  const handleBack = () => {
    setSelectedRoute("");
  };

  return (
    <div style={{ padding: "1rem", background: "linear-gradient(to bottom right, #e0f7fa, #ccffcc)" }}>
      {/* Top Header */}
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: "1rem" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src={logo} alt="In-Flight Insights Logo" style={{ height: "60px", marginRight: "10px" }} />
          <h1 style={{ color: "#1976D2" }}>✈️ In-Flight Insights Dashboard</h1>
        </div>
        <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
          <input
            type="text"
            placeholder="Enter Flight Route"
            value={searchRoute}
            onChange={(e) => setSearchRoute(e.target.value)}
            style={{ padding: "6px", borderRadius: "4px", border: "1px solid #ccc" }}
          />
          <button onClick={handleSearch} style={{ padding: "6px 12px", backgroundColor: "#1976D2", color: "white", border: "none", borderRadius: "4px", cursor: "pointer" }}>
            Search
          </button>
          <a href="#" style={{ color: "#1976D2", fontWeight: "bold", marginLeft: "1rem" }}>Dashboard</a>
          <a href="#" style={{ color: "#1976D2", fontWeight: "bold", marginLeft: "1rem" }}>Reports</a>
          <a href="#" style={{ color: "#1976D2", fontWeight: "bold", marginLeft: "1rem" }}>Settings</a>
          <a href="#" style={{ color: "#1976D2", fontWeight: "bold", marginLeft: "1rem" }}>Profile</a>
        </div>
      </div>

      {/* KPI Cards */}
      <div style={{ display: "flex", justifyContent: "space-around", marginBottom: "1rem" }}>
        {[
          { label: "💰 Cost Savings", value: "$1.2M" },
          { label: "♻️ Waste Saved", value: "210 kg" },
          { label: "✈️ Routes Analyzed", value: "350" },
          { label: "🌍 CO₂ Saved", value: "28 tonnes" },
        ].map((kpi, idx) => (
          <div key={idx} style={{
            flex: 1,
            background: "linear-gradient(to right, #e0f7fa, #e0ffe0)",
            borderRadius: "12px",
            padding: "1rem",
            textAlign: "center",
            margin: "0 0.5rem",
            boxShadow: "0 2px 6px rgba(0,0,0,0.1)"
          }}>
            <h3 style={{ fontSize: "1.2rem" }}>{kpi.label}</h3>
            <p style={{ fontSize: "1.5rem", fontWeight: "bold" }}>{kpi.value}</p>
          </div>
        ))}
      </div>

      {/* Quarterly Route Trend Chart (conditionally rendered on search) */}
      {selectedRoute && (
        <div style={{ marginBottom: "1.5rem", position: "relative" }}>
          <RouteQuarterlyChart route={selectedRoute} />
          <button onClick={handleBack} style={{ position: "absolute", top: 10, right: 20, background: "#f44336", color: "white", border: "none", padding: "4px 10px", borderRadius: "4px", cursor: "pointer" }}>
            Back
          </button>
        </div>
      )}

      {/* Pie Chart Section */}
      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "1.5rem" }}>
        <div style={{ flex: 1, marginRight: "1rem", padding: "1rem", background: "#f9f9f9", borderRadius: "8px" }}>
          <h3 style={{ textAlign: "center" }}>Consumption Breakdown</h3>
          <div style={{ display: "flex", justifyContent: "space-around" }}>
            <PieChartFood />
            <PieChartBeverage />
          </div>
        </div>
        <div style={{ flex: 1, padding: "1rem", background: "#f9f9f9", borderRadius: "8px" }}>
          <RouteLineChart />
        </div>
      </div>

      {/* Bar Chart and Details Section */}
      <div>
        <h2>Waste by Age Group</h2>
        <BarChartComponent />
        <AgeGroupDetails />
      </div>
    </div>
  );
}

export default Dashboard;
